const AsapRegular = `@font-face { font-family: 'Asap'; font-style: normal; font-weight: 400; src: local('Asap Regular'), local('Asap-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const AsapItalic = `@font-face { font-family: 'Asap'; font-style: italic; font-weight: 400; src: local('Asap Italic'), local('Asap-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Asap500 = `@font-face { font-family: 'Asap'; font-style: normal; font-weight: 500; src: local('Asap Medium'), local('Asap-Medium'), url('data:font/woff2;base64,') format('woff2'); }`;
const Asap500italic = `@font-face { font-family: 'Asap'; font-style: italic; font-weight: 500; src: local('Asap Medium Italic'), local('Asap-MediumItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Asap600 = `@font-face { font-family: 'Asap'; font-style: normal; font-weight: 600; src: local('Asap SemiBold'), local('Asap-SemiBold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Asap600italic = `@font-face { font-family: 'Asap'; font-style: italic; font-weight: 600; src: local('Asap SemiBold Italic'), local('Asap-SemiBoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
